import './App.css';
import Box from './Box';
import Counter from './Counter';
import { useEffect } from 'react';
import { useState } from 'react';

function App() {

  useEffect( () => {
    console.log('App');
  });

  const [count, updateCount] = useState(0);

  function boxClicked() {
    console.log('boxClicked');
    updateCount(count + 1);
  }

  const [count1, updateCount1] = useState(0);
  const [count2, updateCount2] = useState(0);

  return (
    <div className="App">
      <header className="App-header">
      </header>
      <div className="boxes">
        <Box name="caja 1" brotherCount={count2} boxClicked={boxClicked}/>
        <Box name="caja 2" brotherCount={count1} boxClicked={boxClicked}/>
        <br/>
        <p>Contador padre: {count} </p>
      </div>
      <Counter/>
    </div>
  );
}

export default App;
